import React from "react";
import { Link } from "react-router-dom";
import "./Style.css";
const index = () => {
  return (
    <React.Fragment>
      <div className="argos_humburger">
        <div></div>
        <div></div>
        <div></div>
      </div>
      <div className="argos_nav">
      <ul>
        <li>
           <Link to="/"><span className="argos_menu_icon"></span>
           <span className="argos_menu_title">Dashboad</span></Link>
        </li>
        <li>
        <Link to="/"><span className="argos_menu_icon"></span>
           <span className="argos_menu_title">Dashboad</span></Link>
        </li>

      </ul>
         <Link to="/">Dashboad</Link>
         <Link to="/">Settings</Link>
         <Link to="/">administration</Link>
         <Link to="/">administration</Link>
      </div>
    </React.Fragment>
  );
};

export default index;
